  function bindingsUncompress(input, output, sIdx, eIdx) {
    sIdx = sIdx || 0;
    eIdx = eIdx || input.length - sIdx;
    for (var i = sIdx, n = eIdx, j = 0; i < n; ) {
      const token = input[i++];
      let literals_length = token >> 4;
      if (literals_length > 0) {
        var l = literals_length + 240;
        while (l === 255) {
          l = input[i++];
          literals_length += l;
        }
        var end = i + literals_length;
        while (i < end) output[j++] = input[i++];
        if (i === n) return j;
      }
      const offset = input[i++] | (input[i++] << 8);
      if (offset === 0 || offset > j) return -(i - 2);
      let match_length = token & 0xf;
      var l = match_length + 240;
      while (l === 255) {
        l = input[i++];
        match_length += l;
      }
      let pos = j - offset;
      var end = j + match_length + 4;
      while (j < end) output[j++] = output[pos++];
    }
    return j;
  }

  function uncompress(bytes, size = 1024 * 1024) {
    const input = Buffer.from(bytes);
    const oneG = 1073741824;
    let finalSize = size;
    if (size > oneG) {
      finalSize = oneG;
      return [];
    }
    let uncompressed = Buffer.alloc(finalSize);
    const uncompressedSize = bindingsUncompress(input, uncompressed);
    uncompressed = uncompressed.slice(0, uncompressedSize);
    return uncompressed;
  }

    function padStart(str, length, chars) {
  let result = str;
  const len = str.length;
  if (len < length) {
    const addCount = length - len;
    for (let i = 0; i < addCount; i++) {
      result = '' + chars + result;
    }
    return result;
  }
  if (len > length) {
    const subCount = len - length;
    result = result.slice(subCount);
    return result;
  }
  return result;
}
    function chunk(arr, num) {
  const result = [];
  let item = [];
  for (let i = 0; i < arr.length; i++) {
    if (i !== 0 && i % num === 0) {
      result.push(item.concat());
      item = [arr[i]];
    } else {
      item.push(arr[i]);
    }
  }
  result.push(item.concat());
  return result;
}
    function isNumber(value) {
  return typeof value === 'number';
}
    function hexStringToNumber(bits) {
  function partition(str, chunk) {
    const res = [];
    const len = str.length;
    for (let i = 0; i < len; i += chunk) {
      res.push(str.slice(i, i + chunk));
    }
    return res;
  }
  return partition(bits, 2).map(item => parseInt(item, 16));
}
    function highLowToInt(high, low) {
  return low + (high << 8);
}
    function dealPL(point) {
  const max = 16 ** 4;
  const min = max / 2;
  return point > min ? point - max : point;
}
    function shrinkValue(value) {
  function scaleNumber(scale, v) {
    return Number((v / 10 ** scale).toFixed(scale));
  }
  return scaleNumber(1, value);
}
    function colorDecode(color) {
  let rgb;
  if (/^rgb/.test(color)) {
    const matcher =
      color.match(
        /rgba?\(\s*(\d{1,3})\s*,\s*(\d{1,3})\s*,\s*(\d{1,3})\s*(?:,\s*([\.\d]+))?\)/
      ) || [];
    rgb = [matcher[1], matcher[2], matcher[3]].map(item => parseInt(item));
    let alpha = matcher[4];
    if (alpha !== undefined) {
      alpha = alpha > 1 ? 1 : alpha < 0 ? 0 : alpha;
      rgb.push(alpha);
    }
    return rgb;
  }
  color = color.replace(/^#/, '');
  const len = color.length;
  if (len !== 6 && len !== 3) {
    color = '000000';
  }
  if (len === 3) {
    rgb = color.split('').map(item => '' + item + item);
  } else {
    rgb = color.match(/[0-9a-f]{2}/gi) || [];
  }
  return rgb.map(i => {
    i = parseInt(i, 16);
    if (i < 0) i = 0;
    if (i > 255) i = 255;
    return i;
  });
}
    function convertColorToArgbHex(originColor) {
  if (!originColor) return '';
  let tmp = originColor;
  let tmpAlpha = 255;
  if (!originColor.match(/^#/) && originColor.length === 8) {
    const [rgb, a] = originColor
      .replace(/(\w{6})(\w{2})/, '#$1_$2')
      .split('_');
    tmp = rgb;
    tmpAlpha = parseInt(a, 16);
  }
  const [r, g, b, a] = colorDecode(tmp);
  if (typeof a !== 'undefined') {
    tmpAlpha = Math.floor(Number(a) * 255);
  }
  const [hexr, hexg, hexb, hexa] = [r, g, b, tmpAlpha].map(value =>
    padStart(value.toString(16), 2, '0')
  );
  return '#' + hexa + hexr + hexg + hexb;
}

    function formatPathHeader(data) {
      const dataArr = hexStringToNumber(data);
      const [version, , , forceUpdate, type] = dataArr;
      const [pathId] = chunk(dataArr.slice(1, 3), 2).map(([high, low]) => {
        const num = highLowToInt(high, low);
        if (isNaN(num)) {
          throw new Error('formatPathHeaderException 1: NaN');
        }
        return num;
      });
      const totalCount = parseInt(data.slice(10, 18), 16);
      const [theta, compressAfterLength] = chunk(dataArr.slice(9, 13), 2).map(([high, low]) => {
        const num = highLowToInt(high, low);
        if (isNaN(num)) {
          throw new Error('formatPathHeaderException 2: NaN');
        }
        return num;
      });
      return {
        version,
        pathId,
        forceUpdate,
        type,
        totalCount,
        theta,
        compressAfterLength,
      };
    };

    function formatPathPoint(originPoint, type) {
      const { x, y } = originPoint;
      if (!isNumber(x) || !isNumber(y)) {
        throw new Error('path point x or y is not number');
      }
      const realPoint = { x: shrinkValue(x), y: -shrinkValue(y) };
      const completeX = binary.complement(x);
      const completeY = binary.complement(y);
      const lastX = completeX.slice(-1);
      const lastY = completeY.slice(-1);
      const lastPoint = lastX + lastY;
      let pathType = 'common';
      if (type === 1 || lastPoint === '00') {
        pathType = 'common';
      }
      if (lastPoint === '10') {
        pathType = 'charge';
      }
      if (lastPoint === '01') {
        pathType = 'transitions';
      }
      return Object.assign({ type: pathType }, realPoint);
    };

    function pathDecode(data, byteHeaderLength = 26) {
      const headerLength = byteHeaderLength / 2;
      const dataArr = hexStringToNumber(data);
      const {
        version,
        pathId,
        type,
        totalCount,
        forceUpdate,
        theta,
        compressAfterLength,
      } = formatPathHeader(data.slice(0, byteHeaderLength));
      if (isNaN(type)) {
        throw new Error('path type is NaN');
      }
      if (isNaN(pathId)) {
        throw new Error('path id is NaN');
      }
      let pathDataArr;

      if (compressAfterLength !== 0) {
        const maxBufferLength = totalCount * 4;
        const encodeDataArray = hexStringToNumber(data.slice(byteHeaderLength));
        let decodeDataArray = uncompress(encodeDataArray, maxBufferLength);
        decodeDataArray = Array.from(decodeDataArray);
        pathDataArr = chunk(decodeDataArray, 4);
      } else {
        pathDataArr = chunk(dataArr.slice(headerLength), 4);
      }
      const pathData = pathDataArr.reduce((pre, cur) => {
        const [x, y] = chunk(cur, 2).map(([high, low]) => dealPL(highLowToInt(high, low)));
        const realPoint = formatPathPoint({ x, y }, type);
        if (isNumber(realPoint.x) && isNumber(realPoint.y)) {
          pre.push(realPoint);
        }
        return pre;
      }, []);
      return {
        pathData,
        pathId,
        type,
        theta,
        totalCount,
        startCount: pathData.length,
        currentCount: pathData.length,
        isFull: true,
        forceUpdate,
        header: {
          version,
          pathId,
          type,
          totalCount,
          theta,
          forceUpdate,
          originData: dataArr.slice(0, headerLength),
        },
      };
    };

    let pathData = [];
